INSERT INTO `tb_info` (`id_info`, `judul`, `deskripsi`, `created_at`, `image`) VALUES
(1, 'Lebih Parah dari Jakarta, Ini Daftar Kota Paling Tercemar Polusi Udara', 'KOMPAS.com - Jakarta tengah menjadi sorotan karena polusi udaranya yang terlalu pekat. Gubernur DKI Jakarta Anies Baswedan juga sudah mengeluarkan Instruksi Gubernur (Ingub) Nomor 66 Tahun 2019 pada Kamis untuk mengatasi masalah ini.\r\n\r\n', '2019-08-02', 'http://android.polusi.id/carepol_juara/image/gambar1.jpg'),
(2, 'Soal Polusi Udara Jakarta Buruk Saat Malam, Begini Kata BMKG\r\n\r\n', 'KOMPAS.com - Berbicara tentang Jakarta, salah satu yang paling kita ingat mungkin polusinya.\r\n\r\n', '2019-06-26', 'http://android.polusi.id/carepol_juara/image/gambar2.jpg'),
(3, 'Ini Langkah-Langkah Atasi Dampak Asap Kebakaran Hutan', 'Liputan6.com, Jakarta Di Indonesia, kebakaran hutan hampir terjadi setiap tahun, terutama pada musim kemarau. Pada 1997, kebakaran hutan terjadi pada area seluas 300 ribu hektare. Badan Nasional Penanggulangan Bencana (BNPB) menyatakan luas kebakaran hutan dan lahan (karhutla) di Indonesia mulai Januari hingga Agustus 2019 mencapai 328,724 hektare, dengan daerah terdampak di Riau.', '2019-09-26', 'http://android.polusi.id/carepol_juara/image/gambar3.jpg');
INSERT INTO `tb_sumber` (`id_sumber`, `judul`, `deskripsi`, `created_at`, `image`) VALUES
