(2, 'Asap dari pabrik membuat kondisi udara semakin buruk', '', '2019-09-24', 'http://android.polusi.id/carepol_juara/image/sumber2.jpg'),
(3, 'Selain itu pembakaran sampah juga sangat membantu dalam meningkatnya polusi udara', '', '2019-10-01', 'http://android.polusi.id/carepol_juara/image/sumber3.jpg');
